			<div class="dash-view">
				<h2 class="view-heading">Valor total emprestado</h2>
				<div class="dash-card">
      <div id="stats-container">
      <h5 class="lg-nmbr">{App.amountTaken}</h5>
	  <p>Emprestimo total</p>
      </div>
    </div>
			</div>
		);
	}
}

export default EmprestimoTotal
